import React from 'react';

const templates = [
  {
    title: 'Memescope OG',
    summary: 'Looks for early bonding curve plays with rising buys and wallet overlap.',
    tags: ['Meme', 'Low MC', 'Aggro'],
    winRate: '68%',
    users: 1240,
    color: 'from-pink-400 to-yellow-400',
  },
  {
    title: 'Early Bonding Sniper',
    summary: 'Snipe low cap plays before full bonding curve forms.',
    tags: ['Low Cap', 'Bonding', 'Dev Active'],
    winRate: '72%',
    users: 980,
    color: 'from-blue-400 to-cyan-400',
  },
  {
    title: 'Narrative Surge – GambleFi',
    summary: 'Ride narratives gaining traction in a given day.',
    tags: ['GambleFi', 'Narrative', 'Volume'],
    winRate: '61%',
    users: 1123,
    color: 'from-purple-400 to-fuchsia-400',
  },
  {
    title: 'Safe Flow (Liquidity Watcher)',
    summary: 'Helps new users avoid rugs or sudden exits.',
    tags: ['Safe', 'Liquidity', 'Holder'],
    winRate: '81%',
    users: 1567,
    color: 'from-green-400 to-emerald-400',
  },
];

export default function TemplatesTab({ goBack, onTryFlow }) {
  return (
    <section className="template-grid bg-black text-white p-6 min-h-screen">
      {goBack && (
        <div className="pt-12 pl-2">
          <button onClick={goBack} className="flex items-center text-sm text-blue-400 hover:underline focus:outline-none bg-black/50 px-3 py-2 rounded-lg backdrop-blur-sm z-50 relative">
            <span className="mr-2">←</span> Back to Home
          </button>
        </div>
      )}
      <h1 className="text-3xl font-bold mb-6">Templates</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {templates.map((tpl) => (
          <div key={tpl.title} className="bg-neutral-900 rounded-xl p-6 border border-neutral-700 flex flex-col">
            <div className="text-xl font-bold mb-1 text-pink-400">{tpl.title}</div>
            <p className="text-sm text-gray-400 mb-3">{tpl.summary}</p>
            <div className="flex flex-wrap gap-2 mb-4 items-center">
              {tpl.tags.map(tag => <span key={tag} className="badge">{tag}</span>)}
              <span className="text-green-400 text-sm">Win Rate: {tpl.winRate}</span>
              <span className="text-blue-400 text-sm">{tpl.users.toLocaleString()} users</span>
            </div>
            <button
              className="bg-gradient-to-r from-pink-400 to-yellow-400 px-4 py-2 rounded text-black font-semibold w-full mt-auto"
              onClick={() => onTryFlow && onTryFlow(tpl)}
            >Try Flow</button>
          </div>
        ))}
      </div>
      <style>{`.badge { background-color: #1e1e2f; padding: 2px 8px; border-radius: 9999px; font-size: 0.75rem; color: #ccc; }`}</style>
    </section>
  );
}
